r-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]--></p>\n<p class="MsoNormal" style="text-align: justify;">\n	<span style="font-size: 12pt;">Uma das tarefas mais comuns no dia a dia do uso do computador &eacute; o <em>COPIAR </em>e <em>COLAR</em>, que se encontram no menu <em>EDITAR </em>de praticamente todas as aplica&ccedil;&otilde;es. Indique qual &eacute; o <strong>atalho </strong>das mesmas:<o:p></o:p></span></p>\n', 22, NULL, '2010-06-23 21:46:02', NULL, NULL),
(6, '<p>\n	O n&uacute;mero 13 convertido ao sistema b&aacute;sico bin&aacute;rio ser&aacute; igual a:</p>\n', 26, '<p>\n	Para se chegar &agrave; resposta correta, basta dividir o n&uacute;mero 13 por 2 at&eacute; encontrar o numerador igual a 1. Faz-se a leitura desse numerador (1) com todos os restos apresentados da direita para a esquerda (101). Resultado 1101.</p>\n', '2010-06-23 21:58:37', '2010-06-23 21:59:08', NULL),
(7, '<p>\n	Na linguagem da inform&aacute;tica, um soquete de conex&atilde;o para um perif&eacute;rico na placa-m&atilde;e &eacute; genericamente conhecido por:<br />\n	&nbsp;</p>\n', 32, '<p>\n	SDRAM &eacute; um tipo de mem&oacute;ria RAM (vol&aacute;til).<br />\n	SLOT ou BUS ou soquetes s&atilde;o as vias de conex&atilde;o de diversos perif&eacute;ricos na placa principal do<br />\n	computador.<br />\n	EPROM &eacute; um tipo de mem&oacute;ria ROM (n&atilde;o vol&aacute;til).<br />\n	STICK &eacute; um perif&eacute;rico.<br />\n	BIOS &eacute; um controlador de entradas e sa&iacute;das do computador</p>\n', '2010-06-23 22:01:55', NULL, NULL),
(8, '<p>\n	Para instruir o Windows XP a receber atualiza&ccedil;&otilde;es importantes &eacute; necess&aacute;rio acionar o &iacute;cone atualiza&ccedil;&otilde;es autom&aacute;tica, original e diretamente localizado no ...</p>\n', 38, '<p>\n	Por meio do Painel de controle tem-se acesso aos recursos fundamentais do sistema operacional Windows. Entre esses, h&aacute; o recurso denominado Central de Seguran&ccedil;a, em que h&aacute; o &iacute;cone de Atualiza&ccedil;&otilde;es Autom&aacute;ticas.</p>\n', '2010-06-23 22:06:41', NULL, NULL),
(9, '<p>\n	A invers&atilde;o de letras mai&uacute;sculas e min&uacute;sculas em um texto selecionado pode ser<br />\n	adicionada diretamente no Word, na sua configura&ccedil;&atilde;o original e padr&atilde;o, por interm&eacute;dio do acesso, em primeira inst&acirc;ncia, ao menu ...</p>\n', 45, '<p>\n	Assim como o F3, quando selecionado o texto, tem a fun&ccedil;&atilde;o de invers&atilde;o de mai&uacute;sculas/min&uacute;sculas, essa caracter&iacute;stica &eacute; acessada por meio do menu formatar.</p>\n', '2010-06-23 22:11:52', NULL, NULL),
(10, '<p>\n	&Eacute; uma op&ccedil;&atilde;o direta e originalmente dispon&iacute;vel em Op&ccedil;&otilde;es de Internet no menu<br />\n	ferramentas do Internet Explorer:</p>\n', 49, '<p>\n	O &uacute;nico recurso dispon&iacute;vel com a op&ccedil;&atilde;o descrita pelo examinador &eacute; limpar hist&oacute;rico, necess&aacute;rio procedimento para liberar espa&ccedil;o no disco r&iacute;gido e melhorar a performance e desempenho do sistema, al&eacute;m de garantir a privacidade da informa&ccedil;&atilde;o.</p>\n', '2010-06-23 22:16:50', NULL, NULL),
