p; </span></span></span></b></span><!--[endif]--><span style="font-size: 12pt;">Web ou WWW</span><span class="conteudoChar"><span style="font-size: 12pt;"><span style="">&nbsp; </span><o:p></o:p></span></span></p>\n				<p class="MsoNormal" style="margin-left: 5.5pt; text-align: justify;">\n					<span class="conteudoChar"><span style="font-size: 12pt;"><span style="">&nbsp;</span><o:p></o:p></span></span></p>\n				<p class="MsoNormal" style="margin-left: 23.5pt; text-align: justify; text-indent: -18pt;">\n					<!--[if !supportLists]--><b style=""><span lang="EN-US" style="font-size: 12pt;"><span style="">2.<span style="font: 7pt &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><!--[endif]--><span style="font-size: 12pt;">Li</span><span lang="EN-US" style="font-size: 12pt;">nks<o:p></o:p></span></p>\n				<p class="MsoNormal" style="text-align: justify;">\n					<span lang="EN-US" style="font-size: 12pt;"><o:p>&nbsp;</o:p></span></p>\n				<p class="MsoNormal" style="margin-left: 23.5pt; text-align: justify; text-indent: -18pt;">\n					<!--[if !supportLists]--><b style=""><span lang="EN-US" style="font-size: 12pt;"><span style="">3.<span style="font: 7pt &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><!--[endif]--><span lang="EN-US" style="font-size: 12pt;">Website<o:p></o:p></span></p>\n				<p class="MsoNormal" style="text-align: justify;">\n					<span lang="EN-US" style="font-size: 12pt;"><o:p>&nbsp;</o:p></span></p>\n				<p class="MsoNormal" style="margin-left: 36pt; text-align: justify; text-indent: -30.5pt;">\n					<!--[if !supportLists]--><b style=""><span lang="EN-US" style="font-size: 12pt;"><span style="">4.<span style="font: 7pt &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><!--[endif]--><span lang="EN-US" style="font-size: 12pt;">URL<o:p></o:p></span></p>\n			</td>\n			<td style="padding: 0cm 5.4pt;" valign="top">\n				<p class="MsoNormal" style=